    public  String proc(String infoCheckResult){
        JSONObject res = JSON.parseObject(infoCheckResult);
        JSONArray jsonArray =  res.getJSONArray("hitDetectItems");
        int len = jsonArray.size();
        for(int i = 0 ; i < len; i++){
            JSONObject tmp = (JSONObject) jsonArray.get(i);
            String val = (String)tmp.get("detectTypeCode");
            if ("repeatModel".equals(val)){
                return (String) tmp.get("detectResouceLevel");
            }
        }
        return null;

    }

